(function(angular){"use strict";angular.module("angulartics.hubspot",["angulartics"]).config(["$analyticsProvider",function($analyticsProvider){$analyticsProvider.settings.pageTracking.autoTrackFirstPage=false;$analyticsProvider.registerPageTrack(function(path){if(window._hsq){_hsq.push();_hsq.push(["trackPageView",path])}});$analyticsProvider.registerEventTrack(function(action,properties){if(properties.value){var parsed=parseInt(properties.value,10);properties.value=isNaN(parsed)?0:parsed}if(window._hsq){_hsq.push();_hsq.push(["trackEvent",{id:action,value:properties.value}])}});$analyticsProvider.registerSetUserProperties(function(properties){if(window._hsq){_hsq.push(["identify",properties])}})}])})(angular);